import { useDispatch, useSelector } from "react-redux";
import{getPokemon}from '../Store/action'
import Buscar from "./Buscar";
import './pokemon.css';
import PokemonCard from "./PokemonCard";


export function PokemonGrid(){
    
    const pokemones=useSelector(store=>store.pokemons)
    console.log(pokemones)
    console.log()

    return(
        <div className="box">   
           
            <ul className="box">
                {
                    pokemones.map((i) => <PokemonCard 
                    src={i.image} 
                    name={i.name}
                    tipo={i.tipo}
                    image={i.imag}/> )
                            
                }
            </ul>
        </div>
    );
};
